import React, { useState } from 'react';
import Book from './components/Books';
import data from './models/books.json';

const App = (props) => {
  const [books] = useState(data);
  return (
    <div>
      {books.map(book => <Book key ={book.id} book={book}/>)}
    </div>
  )
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
export default App;

